import React from 'react'
import './CloudsCloudy.css'
export default class CloudsCloudy extends React.Component {
  constructor(props) {
    super(props)
  }
  componentDidMount() {
    setInterval(() => {
      const cloudsContainer = document.querySelector('.animationClouds');
      const clouds = document.querySelector('.animationClouds').children;
      const cloud = clouds[1].cloneNode();
      cloudsContainer.removeChild(clouds[1])
      cloudsContainer.insertBefore(cloud, clouds[0])
    }, 5000)
